class SetupScreen(Screen):
    def __init__(self, **kwargs):
        super().__init__(**kwargs)
        layout = BoxLayout(orientation='vertical', padding=[50, 100], spacing=20)
        
        # Logo placeholder (can be an Image widget if resource exists)
        self.logo = Label(text="[ ALLMA ]", font_size='40sp', color=(0, 1, 1, 1), size_hint=(1, 0.3))
        
        self.status_label = Label(
            text="Checking System...", 
            font_size='20sp', 
            halign='center', 
            valign='middle'
        )
        self.status_label.bind(size=self.status_label.setter('text_size'))
        
        self.progress_bar = ProgressBar(max=100, value=0, size_hint=(1, None), height=30)
        self.progress_bar.opacity = 0 # Hide initially
        
        self.details_label = Label(text="", font_size='14sp', color=(0.7, 0.7, 0.7, 1))
        
        layout.add_widget(self.logo)
        layout.add_widget(self.status_label)
        layout.add_widget(self.progress_bar)
        layout.add_widget(self.details_label)
        
        self.add_widget(layout)
        self.downloader = None

    def on_enter(self):
        # Delayed import to ensure sys.path is ready
        try:
            from allma_model.utils.model_downloader import ModelDownloader
            self.downloader = ModelDownloader()
            self.check_models()
        except ImportError as e:
            self.status_label.text = f"Setup Error: {e}"
            print(f"Setup Error: {e}")

    def check_models(self):
        self.status_label.text = "Verifying AI Models..."
        # Run check in background to avoid freezing UI
        threading.Thread(target=self._check_background).start()

    def _check_background(self):
        missing = self.downloader.check_models_missing()
        Clock.schedule_once(lambda dt: self._process_missing(missing), 0)

    def _process_missing(self, missing):
        if not missing:
            self.status_label.text = "All Systems Go!"
            self.progress_bar.value = 100
            self.progress_bar.opacity = 1
            Clock.schedule_once(self.go_to_chat, 1.5)
        else:
            self.status_label.text = f"Downloading {len(missing)} AI Models..."
            self.progress_bar.opacity = 1
            self.downloader.start_background_download(
                missing,
                self.update_progress,
                self.download_complete
            )

    def update_progress(self, model_key, downloaded, total):
        def _ui_update(dt):
            if total > 0:
                percent = (downloaded / total) * 100
                self.progress_bar.value = percent
                self.details_label.text = f"{model_key}: {int(percent)}% ({downloaded//1024//1024}MB / {total//1024//1024}MB)"
        Clock.schedule_once(_ui_update, 0)

    def download_complete(self, success, error_msg):
        def _finish(dt):
            if success:
                self.status_label.text = "Download Complete!"
                self.details_label.text = "Initializing..."
                Clock.schedule_once(self.go_to_chat, 1)
            else:
                self.status_label.text = "Download Failed"
                self.details_label.text = str(error_msg)
                # User might need to restart or retry manually
                retry_btn = Button(text="Retry", size_hint=(1, 0.1), on_press=lambda x: self.check_models())
                self.children[0].add_widget(retry_btn)
        Clock.schedule_once(_finish, 0)

    def go_to_chat(self, dt):
        if self.manager.has_screen('chat'):
            self.manager.current = 'chat'

